import React from "react";
import styled from "@emotion/styled";

export const NotDivContainer = styled.div`
  width: 100%;
`;

export const NotDiv = styled.div`
  display: flex;
  text-align: center;
  padding-top: 20rem;
  font-size: 20rem;
  font-weight: 600;
`;

export const NotFound: React.FC = () => {
  return (
    <NotDivContainer>
      <NotDiv>
        <div>4</div>0<div>4</div>
      </NotDiv>
    </NotDivContainer>
  );
};
